CREATE TABLE `#__acymailing_list` (   `name` varchar(250) NOT NULL,   `description` text,   `ordering` smallint(5) unsigned DEFAULT '0',   `listid` smallint(5) unsigned NOT NULL AUTO_INCREMENT,   `published` tinyint(4) DEFAULT NULL,   `userid` int(10) unsigned DEFAULT NULL,   `alias` varchar(250) DEFAULT NULL,   `color` varchar(30) DEFAULT NULL,   `visible` tinyint(4) NOT NULL DEFAULT '1',   `welmailid` mediumint(9) DEFAULT NULL,   `unsubmailid` mediumint(9) DEFAULT NULL,   `type` enum('list','campaign') NOT NULL DEFAULT 'list',   `access_sub` varchar(250) DEFAULT 'all',   `access_manage` varchar(250) NOT NULL DEFAULT 'none',   `languages` varchar(250) NOT NULL DEFAULT 'all',   `startrule` varchar(50) NOT NULL DEFAULT '0',   `category` varchar(250) NOT NULL DEFAULT '',   PRIMARY KEY (`listid`),   KEY `typeorderingindex` (`type`,`ordering`),   KEY `useridindex` (`userid`),   KEY `typeuseridindex` (`type`,`userid`) ) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;
