CREATE TABLE `#__acymailing_mail` (   `mailid` mediumint(8) unsigned NOT NULL AUTO_INCREMENT,   `subject` varchar(250) NOT NULL,   `body` longtext NOT NULL,   `altbody` longtext NOT NULL,   `published` tinyint(4) DEFAULT '1',   `senddate` int(10) unsigned DEFAULT NULL,   `created` int(10) unsigned DEFAULT NULL,   `fromname` varchar(250) DEFAULT NULL,   `fromemail` varchar(250) DEFAULT NULL,   `replyname` varchar(250) DEFAULT NULL,   `replyemail` varchar(250) DEFAULT NULL,   `type` enum('news','autonews','followup','unsub','welcome','notification','joomlanotification') NOT NULL DEFAULT 'news',   `visible` tinyint(4) NOT NULL DEFAULT '1',   `userid` int(10) unsigned DEFAULT NULL,   `alias` varchar(250) DEFAULT NULL,   `attach` text,   `html` tinyint(4) NOT NULL DEFAULT '1',   `tempid` smallint(6) NOT NULL DEFAULT '0',   `key` varchar(200) DEFAULT NULL,   `frequency` varchar(50) DEFAULT NULL,   `params` text,   `sentby` int(10) unsigned DEFAULT NULL,   `metakey` text,   `metadesc` text,   `filter` text,   `language` varchar(50) NOT NULL DEFAULT '',   `abtesting` varchar(250) DEFAULT NULL,   `thumb` varchar(250) DEFAULT NULL,   `summary` text NOT NULL,   PRIMARY KEY (`mailid`),   KEY `senddate` (`senddate`),   KEY `typemailidindex` (`type`,`mailid`),   KEY `useridindex` (`userid`) ) ENGINE=MyISAM AUTO_INCREMENT=17 DEFAULT CHARSET=utf8;
INSERT INTO `#__acymailing_mail`  VALUES ('1', 'New Subscriber on your website : {user:email}', '<p>Hello {subtag:name},</p><p>A new user has been created in AcyMailing : </p><blockquote><p>Name : {user:name}</p><p>Email : {user:email}</p><p>IP : {user:ip} </p><p>Subscription : {user:subscription}</p></blockquote>', '', '1', NULL, NULL, NULL, NULL, NULL, NULL, 'notification', '0', NULL, 'notification_created', NULL, '1', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, ''), ('2', 'A User unsubscribed from all your lists : {user:email}', '<p>Hello {subtag:name},</p><p>The user {user:name} : {user:email} unsubscribed from all your lists</p><p>Subscription : {user:subscription}</p><p>{survey}</p>', '', '1', NULL, NULL, NULL, NULL, NULL, NULL, 'notification', '0', NULL, 'notification_unsuball', NULL, '1', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, ''), ('3', 'A User unsubscribed : {user:email}', '<p>Hello {subtag:name},</p><p>The user {user:name} : {user:email} unsubscribed from your list</p><p>Subscription : {user:subscription}</p><p>{survey}</p>', '', '1', NULL, NULL, NULL, NULL, NULL, NULL, 'notification', '0', NULL, 'notification_unsub', NULL, '1', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, ''), ('4', 'A User refuses to receive e-mails from your website : {user:email}', '<p>The User {user:name} : {user:email} refuses to receive any e-mail anymore from your website.</p><p>Subscription : {user:subscription}</p><p>{survey}</p>', '', '1', NULL, NULL, NULL, NULL, NULL, NULL, 'notification', '0', NULL, 'notification_refuse', NULL, '1', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, ''), ('5', '{subtag:name|ucfirst}, {trans:PLEASE_CONFIRM_SUB}', '<div style=\"text-align: center; width: 100%; background-color: #ffffff;\">\r\n			<table style=\"text-align:justify; margin:auto; background-color:#ebebeb; border:1px solid #e7e7e7\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"600\" align=\"center\" bgcolor=\"#ebebeb\">\r\n			<tbody>\r\n			<tr style=\"line-height: 0px;\">\r\n			<td style=\"line-height: 0px;\" height=\"38px\"><img src=\"media/com_acymailing/templates/newsletter-4/top.png\" border=\"0\" alt=\" - - - \" /></td>\r\n			</tr>\r\n			<tr>\r\n			<td style=\"text-align:center\" width=\"600\">\r\n			<table style=\"margin:auto;\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"520\">\r\n			<tbody>\r\n			<tr>\r\n			<td style=\"background-color: #ffffff; border: 1px solid #dbdbdb; padding: 20px; width: 500px; margin: 15px auto; text-align: left;\">\r\n			<h1>Hello {subtag:name|ucfirst},</h1>\r\n			<p>{trans:CONFIRM_MSG}<br /><br />{trans:CONFIRM_MSG_ACTIVATE}</p>\r\n			<br />\r\n			<p style=\"text-align:center;\"><strong>{confirm}{trans:CONFIRM_SUBSCRIPTION}{/confirm}</strong></p>\r\n			</td>\r\n			</tr>\r\n			</tbody>\r\n			</table>\r\n			</td>\r\n			</tr>\r\n			<tr style=\"line-height: 0px;\">\r\n			<td style=\"line-height: 0px;\" height=\"40px\"><img src=\"media/com_acymailing/templates/newsletter-4/bottom.png\" border=\"0\" alt=\" - - - \" /></td>\r\n			</tr>\r\n			</tbody>\r\n			</table>\r\n			</div>', '', '1', NULL, NULL, NULL, NULL, NULL, NULL, 'notification', '0', NULL, 'confirmation', NULL, '1', '1', NULL, NULL, 'a:3:{s:6:\"action\";s:7:\"confirm\";s:13:\"actionbtntext\";s:28:\"{trans:CONFIRM_SUBSCRIPTION}\";s:9:\"actionurl\";s:19:\"{confirm}{/confirm}\";}', NULL, NULL, NULL, NULL, '', NULL, NULL, ''), ('6', 'AcyMailing Cron Report {mainreport}', '<p>{report}</p><p>{detailreport}</p>', '', '1', NULL, NULL, NULL, NULL, NULL, NULL, 'notification', '0', NULL, 'report', NULL, '1', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, ''), ('7', 'A Newsletter has been generated : \"{subject}\"', '<p>The Newsletter issue {issuenb} has been generated : </p><p>Subject : {subject}</p><p>{body}</p>', '', '1', NULL, NULL, NULL, NULL, NULL, NULL, 'notification', '0', NULL, 'notification_autonews', NULL, '1', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, ''), ('8', 'Modify your subscription', '<p>Hello {subtag:name}, </p><p>You requested some changes on your subscription,</p><p>Please {modify}click here{/modify} to be identified as the owner of this account and then modify your subscription.</p>', '', '1', NULL, NULL, NULL, NULL, NULL, NULL, 'notification', '0', NULL, 'modif', NULL, '1', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, ''), ('9', 'Új szavazás legyen FNA?', '<div style=\"text-align: center; width: 100%; background-color: #ffffff;\">\r\n<div class=\"acymailing_online acyeditor_delete acyeditor_text\" style=\"text-align: center;\">{readonline}This email contains graphics, so if you don\'t see them, view it in your browser{/readonline}</div>\r\n<table class=\"w600\" style=\"text-align: justify; margin: auto; width: 600px;\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" align=\"center\">\r\n<tbody>\r\n<tr class=\"acyeditor_delete\" style=\"line-height: 0px;\">\r\n<td class=\"w600\" style=\"background-color: #69b4c0;\" colspan=\"5\" valign=\"bottom\" width=\"600\"><img class=\"w600\" src=\"images/banners/social-media_680x100l.png\" alt=\"social-media 680x100l\" /></td>\r\n</tr>\r\n<tr class=\"acyeditor_delete\">\r\n<td class=\"w40\" style=\"background-color: #ebebeb;\" width=\"40\">&nbsp;</td>\r\n<td class=\"acyeditor_text w520\" style=\"text-align: left; background-color: #ebebeb;\" colspan=\"3\" width=\"520\" height=\"80\"><img style=\"float: left; margin-right: 10px;\" src=\"media/com_acymailing/templates/newsletter-4/images/message_icon.png\" alt=\"-\" />\r\n<h3>Legyen FNA (szerű) juttatás?</h3>\r\n<h4>&nbsp;</h4>\r\n</td>\r\n<td class=\"acyeditor_picture w40\" style=\"background-color: #ebebeb;\" width=\"40\">&nbsp;</td>\r\n</tr>\r\n<tr class=\"acyeditor_delete\">\r\n<td class=\"w40\" style=\"background-color: #ebebeb;\" width=\"40\">&nbsp;</td>\r\n<td class=\"w20\" style=\"background-color: #fff;\" width=\"20\">&nbsp;</td>\r\n<td class=\"w480\" style=\"background-color: #fff;\" width=\"480\" height=\"20\">&nbsp;</td>\r\n<td class=\"w20\" style=\"background-color: #fff;\" width=\"20\">&nbsp;</td>\r\n<td class=\"w40\" style=\"background-color: #ebebeb;\" width=\"40\">&nbsp;</td>\r\n</tr>\r\n<tr class=\"acyeditor_delete\">\r\n<td class=\"w40\" style=\"background-color: #ebebeb;\" width=\"40\">&nbsp;</td>\r\n<td class=\"w20\" style=\"background-color: #fff;\" width=\"20\">&nbsp;</td>\r\n<td class=\"acyeditor_text w480 pict\" style=\"background-color: #fff; text-align: left;\" width=\"480\">\r\n<h1>Kedves Barátaim!</h1>\r\n<p>Új szavazás indult <a href=\"http://li-de.tk\">http://li-de.tk</a> oldalon, </p>\r\n<p>&nbsp;</p>\r\n<p>Kérem szavazzatok!</p>\r\n<p>&nbsp;</p>\r\n<p>Vita1 vége:2014-11-18</p>\r\n<p>Vita2 vége:2014-11-23</p>\r\n<p>Szavazás vége:2014-11-28</p>\r\n<p>&nbsp;</p>\r\n<p>Jelenleg lehet szavazni, kérem szavazzatok és terjesszétek a linket ismerőseitek között is!</p>\r\n<p>&nbsp;</p>\r\n<p>Közvetlen link a szavazásra:</p>\r\n<p>&nbsp;</p>\r\n<p><a href=\"index.php?option=com_alternativak&amp;view=alternativaklist&amp;task=browse&amp;limit=20&amp;limitstart=0&amp;filterStr=&amp;order=1&amp;temakor=33&amp;szavazas=42\">http://li-de.tk/index.php?option=com_alternativak&amp;view=alternativaklist&amp;task=browse&amp;limit=20&amp;limitstart=0&amp;filterStr=&amp;order=1&amp;temakor=33&amp;szavazas=42</a></p>\r\n</td>\r\n<td class=\"w20\" style=\"background-color: #fff;\" width=\"20\">&nbsp;</td>\r\n<td class=\"w40\" style=\"background-color: #ebebeb;\" width=\"40\">&nbsp;</td>\r\n</tr>\r\n<tr class=\"acyeditor_delete\">\r\n<td class=\"w40\" style=\"background-color: #ebebeb;\" width=\"40\">&nbsp;</td>\r\n<td class=\"w20\" style=\"background-color: #fff;\" width=\"20\">&nbsp;</td>\r\n<td class=\"w480\" style=\"background-color: #fff;\" width=\"480\" height=\"20\">&nbsp;</td>\r\n<td class=\"w20\" style=\"background-color: #fff;\" width=\"20\">&nbsp;</td>\r\n<td class=\"w40\" style=\"background-color: #ebebeb;\" width=\"40\">&nbsp;</td>\r\n</tr>\r\n<tr class=\"acyeditor_delete\" style=\"line-height: 0px;\">\r\n<td class=\"w600\" style=\"background-color: #ebebeb;\" colspan=\"5\" width=\"600\"><img class=\"w600\" src=\"media/com_acymailing/templates/newsletter-4/images/bottom.png\" alt=\" - - - \" /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<div class=\"acyeditor_delete acyeditor_text\" style=\"text-align: center;\">Nem akarsz több ilyen levelet kapni? {unsubscribe}Leiratkozás{/unsubscribe}</div>\r\n</div>', '', '1', '1417080576', '1415791006', '', '', '', '', 'news', '1', '66', 'uj-szavazas-legyen-fna', NULL, '1', '1', 'bfd9e773932f1a4102e1ebfcd1274d54', NULL, NULL, '66', '', '', NULL, '', NULL, NULL, ''), ('10', 'New contact from your website : {user:email}', '<p>Hello {subtag:name},</p><p>A user submitted the form : </p><blockquote><p>Name : {user:name}</p><p>Email : {user:email}</p><p>IP : {user:ip} </p><p>Subscription : {user:subscription}</p></blockquote>', '', '1', NULL, NULL, NULL, NULL, NULL, NULL, 'notification', '0', NULL, 'notification_contact', NULL, '1', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, ''), ('11', 'A user subscribed or modified his subscription : {user:email}', '<p>Hello {subtag:name},</p><p>A user submitted the form : </p><blockquote><p>Name : {user:name}</p><p>Email : {user:email}</p><p>IP : {user:ip} </p><p>Subscription : {user:subscription}</p></blockquote>', '', '1', NULL, NULL, NULL, NULL, NULL, NULL, 'notification', '0', NULL, 'notification_contact_menu', NULL, '1', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, ''), ('12', 'A user confirmed his subscription : {user:email}', '<p>Hello {subtag:name},</p><p>A user confirmed his subscription : </p><blockquote><p>Name : {user:name}</p><p>Email : {user:email}</p><p>IP : {user:ip} </p><p>Subscription : {user:subscription}</p></blockquote>', '', '1', NULL, NULL, NULL, NULL, NULL, NULL, 'notification', '0', NULL, 'notification_confirm', NULL, '1', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, ''), ('13', 'EDE projekt', '<div style=\"text-align: center; width: 100%; background-color: #ffffff;\">\r\n<div class=\"acymailing_online acyeditor_delete acyeditor_text\" style=\"text-align: center;\">{readonline}This email contains graphics, so if you don\'t see them, view it in your browser{/readonline}</div>\r\n<table class=\"w600\" style=\"text-align: justify; margin: auto; width: 600px;\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" align=\"center\">\r\n<tbody>\r\n<tr class=\"acyeditor_delete\" style=\"line-height: 0px;\">\r\n<td class=\"w600\" style=\"background-color: #69b4c0;\" colspan=\"5\" valign=\"bottom\" width=\"600\"><img class=\"w600\" src=\"images/banners/social-media_680x100l.png\" alt=\"social-media 680x100l\" /></td>\r\n</tr>\r\n<tr class=\"acyeditor_delete\">\r\n<td class=\"w40\" style=\"background-color: #ebebeb;\" width=\"40\"> </td>\r\n<td class=\"acyeditor_text w520\" style=\"text-align: left; background-color: #ebebeb;\" colspan=\"3\" width=\"520\" height=\"80\"><img style=\"float: left; margin-right: 10px;\" src=\"media/com_acymailing/templates/newsletter-4/images/message_icon.png\" alt=\"-\" />\r\n<h3>Topic of your message</h3>\r\n<h4>Subtitle for your message</h4>\r\n</td>\r\n<td class=\"acyeditor_picture w40\" style=\"background-color: #ebebeb;\" width=\"40\"> </td>\r\n</tr>\r\n<tr class=\"acyeditor_delete\">\r\n<td class=\"w40\" style=\"background-color: #ebebeb;\" width=\"40\"> </td>\r\n<td class=\"w20\" style=\"background-color: #fff;\" width=\"20\"> </td>\r\n<td class=\"w480\" style=\"background-color: #fff;\" width=\"480\" height=\"20\"> </td>\r\n<td class=\"w20\" style=\"background-color: #fff;\" width=\"20\"> </td>\r\n<td class=\"w40\" style=\"background-color: #ebebeb;\" width=\"40\"> </td>\r\n</tr>\r\n<tr class=\"acyeditor_delete\">\r\n<td class=\"w40\" style=\"background-color: #ebebeb;\" width=\"40\"> </td>\r\n<td class=\"w20\" style=\"background-color: #fff;\" width=\"20\"> </td>\r\n<td class=\"acyeditor_text w480 pict\" style=\"background-color: #fff; text-align: left;\" width=\"480\">\r\n<h1>Kedves bBartárom {subtag:name},</h1>\r\n<p style=\"text-align: right;\"><button type=\"button\"><strong>X</strong></button></p>\r\n<p>Az \"Informatikusok az E demokráciárt\" csoport mintegy 4-5 fő \"erős informatikus\" részvételével.  Ez a csoport más uton kivánja az e-demokráciát megoldani, nevezetesen a AIRESIS szoftverre támaszkodva.</p>\r\n<p><a href=\"http://airesis.eu\" style=\"font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 11px;\">http://airesis.eu</a></p>\r\n<p><a href=\"https://www.facebook.com/edemomakers\">https://www.facebook.com/edemomakers</a>  <a href=\"https://www.facebook.com/edemomakers\"></a></p>\r\n<p><span id=\"docs-internal-guid-28a2bb59-fdbc-9fa3-4e98-03e4e3cb4ef4\" style=\"line-height: 18px;\"><span style=\"font-size: 32px; font-family: Arial; color: #ffffff; vertical-align: baseline; white-space: pre-wrap; background-color: transparent;\">Airesis: </span></span><span id=\"docs-internal-guid-28a2bb59-fdbc-9fa3-4e98-03e4e3cb4ef4\" style=\"line-height: 18px;\"><span style=\"font-size: 32px; font-family: Arial; color: #ffffff; vertical-align: baseline; white-space: pre-wrap; background-color: transparent;\"> (</span><span style=\"font-size: 24px; font-family: Arial; color: #ffffff; vertical-align: baseline; white-space: pre-wrap; background-color: transparent;\">RubyOnRails, pgSQL</span><span style=\"font-size: 32px; font-family: Arial; color: #ffffff; vertical-align: baseline; white-space: pre-wrap; background-color: transparent;\">)</span></span></p>\r\n<p>Ez a szoftver NEM LIKVID DEMOKRÁCIA hanem KÖZVETLEN DEMOKRÁCIA megvalósítás.</p>\r\n<p>Fő jellemzői:</p>\r\n<p>- integrált fórum</p>\r\n<p>- integrált dokumentáció tár</p>\r\n<p>- integrált naptár</p>\r\n<p>- csoportok hozhatóak létre (egyenlőre úgy látom egy szintű, de tovább lesz fejlesztve strukturálra)</p>\r\n<p>- preferenciális szavazás Condorcet kiértékeléssel</p>\r\n<p> </p>\r\n<p>Az ezzel kapcsolatos viszonyunkról kiirtam egy szavazást, kérlek nézzétek meg, kommenteljetek, javasoljatok alternativákat majd amikor ennek eljön az ideje szavazzatok!</p>\r\n<p><a href=\"index.php?option=com_alternativak&amp;view=alternativaklist&amp;task=browse&amp;limit=20&amp;limitstart=0&amp;filterStr=&amp;order=1&amp;temakor=37&amp;szavazas=45\">http://li-de.tk/index.php?option=com_alternativak&amp;view=alternativaklist&amp;task=browse&amp;limit=20&amp;limitstart=0&amp;filterStr=&amp;order=1&amp;temakor=37&amp;szavazas=45</a></p>\r\n<p> </p>\r\n</td>\r\n<td class=\"w20\" style=\"background-color: #fff;\" width=\"20\"> </td>\r\n<td class=\"w40\" style=\"background-color: #ebebeb;\" width=\"40\"> </td>\r\n</tr>\r\n<tr class=\"acyeditor_delete\">\r\n<td class=\"w40\" style=\"background-color: #ebebeb;\" width=\"40\"> </td>\r\n<td class=\"w20\" style=\"background-color: #fff;\" width=\"20\"> </td>\r\n<td class=\"w480\" style=\"background-color: #fff;\" width=\"480\" height=\"20\"> </td>\r\n<td class=\"w20\" style=\"background-color: #fff;\" width=\"20\"> </td>\r\n<td class=\"w40\" style=\"background-color: #ebebeb;\" width=\"40\"> </td>\r\n</tr>\r\n<tr class=\"acyeditor_delete\" style=\"line-height: 0px;\">\r\n<td class=\"w600\" style=\"background-color: #ebebeb;\" colspan=\"5\" width=\"600\"><img class=\"w600\" src=\"media/com_acymailing/templates/newsletter-4/images/bottom.png\" alt=\" - - - \" /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<div class=\"acyeditor_delete acyeditor_text\" style=\"text-align: center;\">Nem akarsz több ilyen levelet kapni? {unsubscribe}Leiratkozás{/unsubscribe}</div>\r\n</div>', '', '1', '1421596805', '1421596464', '', '', '', '', 'news', '1', '66', 'ede-projekt', NULL, '1', '1', '7JyVwBIf', NULL, NULL, '66', '', '', NULL, '', NULL, NULL, ''), ('14', 'Itt a lehetőség, hogy megismerjük az ELŐVÁLASZTÁS szerepét.', '<div style=\"text-align: center; width: 100%; background-color: #ffffff;\">\r\n<div class=\"acymailing_online acyeditor_delete acyeditor_text\" style=\"text-align: center;\">{readonline}Ez a levél a NET -ről elért grafikai elemeket tartalmaz{/readonline}</div>\r\n<table class=\"w600\" style=\"text-align: justify; margin: auto; width: 600px;\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" align=\"center\">\r\n<tbody>\r\n<tr class=\"acyeditor_delete\" style=\"line-height: 0px;\">\r\n<td class=\"w600\" style=\"background-color: #69b4c0;\" colspan=\"5\" valign=\"bottom\" width=\"600\"><img class=\"w600\" src=\"images/banners/social-media_680x100l.png\" alt=\"social-media 680x100l\" /></td>\r\n</tr>\r\n<tr class=\"acyeditor_delete\">\r\n<td class=\"w40\" style=\"background-color: #ebebeb;\" width=\"40\"> </td>\r\n<td class=\"acyeditor_text w520\" style=\"text-align: left; background-color: #ebebeb;\" colspan=\"3\" width=\"520\" height=\"80\"><img style=\"float: left; margin-right: 10px;\" src=\"media/com_acymailing/templates/newsletter-4/images/message_icon.png\" alt=\"-\" />\r\n<h3>Topic of your message</h3>\r\n<h4>Subtitle for your message</h4>\r\n</td>\r\n<td class=\"acyeditor_picture w40\" style=\"background-color: #ebebeb;\" width=\"40\"> </td>\r\n</tr>\r\n<tr class=\"acyeditor_delete\">\r\n<td class=\"w40\" style=\"background-color: #ebebeb;\" width=\"40\"> </td>\r\n<td class=\"w20\" style=\"background-color: #fff;\" width=\"20\"> </td>\r\n<td class=\"w480\" style=\"background-color: #fff;\" width=\"480\" height=\"20\"> </td>\r\n<td class=\"w20\" style=\"background-color: #fff;\" width=\"20\"> </td>\r\n<td class=\"w40\" style=\"background-color: #ebebeb;\" width=\"40\"> </td>\r\n</tr>\r\n<tr class=\"acyeditor_delete\">\r\n<td class=\"w40\" style=\"background-color: #ebebeb;\" width=\"40\"> </td>\r\n<td class=\"w20\" style=\"background-color: #fff;\" width=\"20\"> </td>\r\n<td class=\"acyeditor_text w480 pict\" style=\"background-color: #fff; text-align: left;\" width=\"480\">\r\n<h1>Kedves Barátom {subtag:name}!</h1>\r\n<p style=\"margin-bottom: 0px; white-space: pre-wrap; color: #141823; font-family: Helvetica, Arial, \'lucida grande\', tahoma, verdana, arial, sans-serif; line-height: 17.9400005340576px;\"><span style=\"line-height: 17.9400005340576px;\">Itt a lehetőség, hogy megismerjük az ELŐVÁLASZTÁS szerepét. A veszprémi időközi választás kapcsán szavazást indítunk, azaz egy előválasztást tartunk, hogy melyik induló jelölt kapná a legtöbb voksot. A szavazás lezárultával megküldjük neketek az elemzést, melyből majd láthatjátok az előválasztás jelentősségét.</span></p>\r\n<p style=\"margin-top: 10px; margin-bottom: 0px; white-space: pre-wrap; color: #141823; font-family: Helvetica, Arial, \'lucida grande\', tahoma, verdana, arial, sans-serif; line-height: 17.9400005340576px;\">A kísérletünk érdekében a jelöltek listáját kiegészítettük 3 olyan (természetesen fiktív) jelölttel, akiknek programja csupán annyi, hogy beviszik a parlamentbe a választók véleményét, álláspontját, azaz azt vállalják, hogy általunk \"távvezérelve\" képviselnek minket az országházban. Hangsúlyozzuk, ez most csak egy kísérlet, egy majdani valós előválasztás szimulációja, tekinthetjük játéknak is, de megvilágíthatja számunkra, mit érhetünk el vele.</p>\r\n<p style=\"margin-top: 10px; margin-bottom: 0px; white-space: pre-wrap; color: #141823; font-family: Helvetica, Arial, \'lucida grande\', tahoma, verdana, arial, sans-serif; line-height: 17.9400005340576px;\">Az alternatív javaslattétel útján még 1 hétig lehetőség van önkéntjelentkezők listára kerülésére közülünk.</p>\r\n<p style=\"margin-top: 10px; margin-bottom: 0px; white-space: pre-wrap; color: #141823; font-family: Helvetica, Arial, \'lucida grande\', tahoma, verdana, arial, sans-serif; line-height: 17.9400005340576px;\">A minél valóságosabb eredmény érdekében, kérjük, hogy minél több jelöltre szavazzatok szimpátia-sorrendben.</p>\r\n</td>\r\n<td class=\"w20\" style=\"background-color: #fff;\" width=\"20\"> </td>\r\n<td class=\"w40\" style=\"background-color: #ebebeb;\" width=\"40\"> </td>\r\n</tr>\r\n<tr class=\"acyeditor_delete\">\r\n<td class=\"w40\" style=\"background-color: #ebebeb;\" width=\"40\"> </td>\r\n<td class=\"w20\" style=\"background-color: #fff;\" width=\"20\"> </td>\r\n<td class=\"w480\" style=\"background-color: #fff;\" width=\"480\" height=\"20\"> </td>\r\n<td class=\"w20\" style=\"background-color: #fff;\" width=\"20\"> </td>\r\n<td class=\"w40\" style=\"background-color: #ebebeb;\" width=\"40\"> </td>\r\n</tr>\r\n<tr class=\"acyeditor_delete\" style=\"line-height: 0px;\">\r\n<td class=\"w600\" style=\"background-color: #ebebeb;\" colspan=\"5\" width=\"600\"><img class=\"w600\" src=\"media/com_acymailing/templates/newsletter-4/images/bottom.png\" alt=\" - - - \" /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<div class=\"acyeditor_delete acyeditor_text\" style=\"text-align: center;\">Nem akarsz több ilyen levelet kapni? {unsubscribe}Leiratkozás{/unsubscribe}</div>\r\n</div>', '', '1', NULL, '1422033078', '', '', '', '', 'news', '1', '66', 'itt-a-lehetoseg-hogy-megismerjuk-az-elovalasztas-szerepet', NULL, '1', '1', 'K4xwC048', NULL, NULL, NULL, '', '', NULL, '', NULL, NULL, ''), ('15', 'Fejlesztések a li-de programban', '<div style=\"text-align: center; width: 100%; background-color: #ffffff;\">\r\n<div class=\"acymailing_online acyeditor_delete acyeditor_text\" style=\"text-align: center;\">{readonline}Ez a levél a NET -ről elért grafikai elemeket tartalmaz{/readonline}</div>\r\n<table class=\"w600\" style=\"text-align: justify; margin: auto; width: 600px;\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" align=\"center\">\r\n<tbody>\r\n<tr class=\"acyeditor_delete\" style=\"line-height: 0px;\">\r\n<td class=\"w600\" style=\"background-color: #69b4c0;\" colspan=\"5\" valign=\"bottom\" width=\"600\"><img class=\"w600\" src=\"images/banners/social-media_680x100l.png\" alt=\"social-media 680x100l\" /></td>\r\n</tr>\r\n<tr class=\"acyeditor_delete\">\r\n<td class=\"w40\" style=\"background-color: #ebebeb;\" width=\"40\"> </td>\r\n<td class=\"acyeditor_text w520\" style=\"text-align: left; background-color: #ebebeb;\" colspan=\"3\" width=\"520\" height=\"80\"><img style=\"float: left; margin-right: 10px;\" src=\"media/com_acymailing/templates/newsletter-4/images/message_icon.png\" alt=\"-\" />\r\n<h3><span style=\"color: inherit; font-family: inherit; font-size: 14px; line-height: 16px;\"></span></h3>\r\n</td>\r\n<td class=\"acyeditor_picture w40\" style=\"background-color: #ebebeb;\" width=\"40\"> </td>\r\n</tr>\r\n<tr class=\"acyeditor_delete\">\r\n<td class=\"w40\" style=\"background-color: #ebebeb;\" width=\"40\"> </td>\r\n<td class=\"w20\" style=\"background-color: #fff;\" width=\"20\"> </td>\r\n<td class=\"w480\" style=\"background-color: #fff;\" width=\"480\" height=\"20\"> </td>\r\n<td class=\"w20\" style=\"background-color: #fff;\" width=\"20\"> </td>\r\n<td class=\"w40\" style=\"background-color: #ebebeb;\" width=\"40\"> </td>\r\n</tr>\r\n<tr class=\"acyeditor_delete\">\r\n<td class=\"w40\" style=\"background-color: #ebebeb;\" width=\"40\"> </td>\r\n<td class=\"w20\" style=\"background-color: #fff;\" width=\"20\"> </td>\r\n<td class=\"acyeditor_text w480 pict\" style=\"background-color: #fff; text-align: left;\" width=\"480\">\r\n<h1>Kedves Barátom {subtag:name},</h1>\r\n<p>Tájékoztatni szeretnélek benneteket, a <a href=\"http://li-de.tk\">http://li-de.tk</a> rendszer néhány újdonságáról:</p>\r\n<ul>\r\n<li>Javítva lett a Facebook és Google fiokos bejelentkezés,így ezek újra használhatóak,</li>\r\n<li>Javítva lett a Kunena fórum és JDownloads file kezelés integráció,</li>\r\n<li>Integrálva lett a rendszerbe a JEvents eseménynaptár, minden témakörhöz automatikusan tartozik egy esemény naptár,</li>\r\n<li>a <a href=\"http://gravatar.com\">http://gravatar.com</a> oldalon profilképet tölthettek fel az e-mail címetekhez, a li-de program ezt a profilképet megjeleníti a fórumban és a hozzászólásoknál,</li>\r\n<li>Lehetőség van az egymáshoz nagyon hasonló szavazások Vágolapra másolással/beillesztéssel történi indítására (pl. folyamatos, ismétlödő szavazások)</li>\r\n</ul>\r\n<p>Kérlek benneteket kommentezzetek, fórumozzatok elsősorban az aktuális témában (EDE rendszer beindulásávalkapcsolatos teendők):</p>\r\n<p><a href=\"index.php?option=com_alternativak&amp;view=alternativaklist&amp;task=browse&amp;limit=20&amp;limitstart=0&amp;filterStr=&amp;order=1&amp;temakor=37&amp;szavazas=45\">http://li-de.tk/index.php?option=com_alternativak&amp;view=alternativaklist&amp;task=browse&amp;limit=20&amp;limitstart=0&amp;filterStr=&amp;order=1&amp;temakor=37&amp;szavazas=45</a></p>\r\n<p> </p>\r\n<p>(de persze bármi más témában is amiben mondanivalótok van)</p>\r\n<p> </p>\r\n<p>Kérlek indítsatok új témákat, szavazásokat, ajánljátok a rendszert ismerőseiteknek, egyesületeknek, kluboknak, csoportoknak!</p>\r\n<p> </p>\r\n<p style=\"text-align: right;\"><strong><em>Utopszkij</em></strong></p>\r\n<p> </p>\r\n</td>\r\n<td class=\"w20\" style=\"background-color: #fff;\" width=\"20\"> </td>\r\n<td class=\"w40\" style=\"background-color: #ebebeb;\" width=\"40\"> </td>\r\n</tr>\r\n<tr class=\"acyeditor_delete\">\r\n<td class=\"w40\" style=\"background-color: #ebebeb;\" width=\"40\"> </td>\r\n<td class=\"w20\" style=\"background-color: #fff;\" width=\"20\"> </td>\r\n<td class=\"w480\" style=\"background-color: #fff;\" width=\"480\" height=\"20\"> </td>\r\n<td class=\"w20\" style=\"background-color: #fff;\" width=\"20\"> </td>\r\n<td class=\"w40\" style=\"background-color: #ebebeb;\" width=\"40\"> </td>\r\n</tr>\r\n<tr class=\"acyeditor_delete\" style=\"line-height: 0px;\">\r\n<td class=\"w600\" style=\"background-color: #ebebeb;\" colspan=\"5\" width=\"600\"><img class=\"w600\" src=\"media/com_acymailing/templates/newsletter-4/images/bottom.png\" alt=\" - - - \" /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<div class=\"acyeditor_delete acyeditor_text\" style=\"text-align: center;\">Nem akarsz több ilyen levelet kapni? {unsubscribe}Leiratkozás{/unsubscribe}</div>\r\n</div>', '', '1', '1422263046', '1422262854', '', '', '', '', 'news', '1', '66', 'fejlesztesek-a-li-de-programban', NULL, '1', '1', 'QRo3CgmU', NULL, NULL, '66', '', '', NULL, '', NULL, NULL, ''), ('16', 'Előválasztás a Veszprémi időközi választáshoz', '<div style=\"text-align: center; width: 600px; background-color: #ffffff;\">\r\n<div class=\"acymailing_online acyeditor_delete acyeditor_text\" style=\"text-align: center;\">{readonline}Ez a levél a NET -ről elért grafikai elemeket tartalmaz{/readonline}</div>\r\n<table class=\"w600\" style=\"text-align: justify; margin: auto; width: 600px;\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" align=\"center\">\r\n<tbody>\r\n<tr class=\"acyeditor_delete\" style=\"line-height: 0px;\">\r\n<td class=\"w600\" style=\"background-color: #69b4c0;\" colspan=\"5\" valign=\"bottom\" width=\"600\"><img class=\"w600\" src=\"images/banners/social-media_680x100l.png\" alt=\"social-media 680x100l\" /></td>\r\n</tr>\r\n<tr class=\"acyeditor_delete\">\r\n<td class=\"w40\" style=\"background-color: #ebebeb;\" width=\"40\"> </td>\r\n<td class=\"acyeditor_text w520\" style=\"text-align: left; background-color: #ebebeb;\" colspan=\"3\" width=\"520\" height=\"80\"><img style=\"float: left; margin-right: 10px;\" src=\"media/com_acymailing/templates/newsletter-4/images/message_icon.png\" alt=\"-\" />\r\n<h3>Előválasztás</h3>\r\n<h4>Veszprém</h4>\r\n</td>\r\n<td class=\"acyeditor_picture w40\" style=\"background-color: #ebebeb;\" width=\"40\"> </td>\r\n</tr>\r\n<tr class=\"acyeditor_delete\">\r\n<td class=\"w40\" style=\"background-color: #ebebeb;\" width=\"40\"> </td>\r\n<td class=\"w20\" style=\"background-color: #fff;\" width=\"20\"> </td>\r\n<td class=\"w480\" style=\"background-color: #fff;\" width=\"480\" height=\"20\"> </td>\r\n<td class=\"w20\" style=\"background-color: #fff;\" width=\"20\"> </td>\r\n<td class=\"w40\" style=\"background-color: #ebebeb;\" width=\"40\"> </td>\r\n</tr>\r\n<tr class=\"acyeditor_delete\">\r\n<td class=\"w40\" style=\"background-color: #ebebeb;\" width=\"40\"> </td>\r\n<td class=\"w20\" style=\"background-color: #fff;\" width=\"20\"> </td>\r\n<td class=\"acyeditor_text w480 pict\" style=\"background-color: #fff; text-align: left;\" width=\"480\">\r\n<h1>Kedves Barátom {subtag:name}!</h1>\r\n<p><img style=\"margin: 5px; float: right;\" src=\"http://azigazsag.hu/az-igazsag-kepekben/-politika.jpg\" alt=\"\" width=\"300\" /><a></a></p>\r\n<p style=\"margin-bottom: 0.5cm;\">Mint bizonyára tudod hamarosan időközi országgyűlési választás lesz Veszprémben.</p>\r\n<p style=\"margin-bottom: 0.5cm;\">Ezt az eseményt nagy érdeklődés kíséri, ugyanis megdőlhet a FIDESZ kétharmada, illetve meglátjuk a kormány népszerűség vesztése hogyan tükröződik a szavazatokban.</p>\r\n<p style=\"margin-bottom: 0.5cm;\">Javaslom, hogy ezzel kapcsolatban rendezzünk egy - félig komoly - internetes előválasztást!</p>\r\n<p style=\"margin-bottom: 0.5cm;\">A levél alján látható linkkel elérhető li-de.tk szavazáson adjátok le a szavazatotokat, ti melyik jelölteket támogatjátok? Ne csak az adott választási körzetbe tartozók szavazzanak!</p>\r\n<p style=\"margin-bottom: 0.5cm;\">Érdekes lesz  ennek az internetes közvélemény kutatásnak és a tényleges szavazási eredmények az összehasonlítása.</p>\r\n<p style=\"margin-bottom: 0.5cm;\">Ez a szavazás preferenciális (Borda) rendszerű, Concordet elv szerinti kiértékeléssel, szemben a tényleges választás primitív \"egy jelöltet támogathatok\" rendszerével. Itt kifejezhetem több jelölttel kapcsolatos szimpátiámat, ellenszenvemet, úgy hogy a jelölteket szimpátia sorrendbe állítom, több jelöltet is rangsorolhatok azonos pozícióba.</p>\r\n<p style=\"margin-bottom: 0.5cm;\">Tehát ez az \"előválasztás\" egyúttal ennek a szavazási módszernek a használhatóságára is példa lesz.</p>\r\n<p style=\"margin-bottom: 0.5cm;\"><strong>Kérlek benneteket szavazzatok!</strong></p>\r\n<p style=\"margin-bottom: 0.5cm;\">Az alábbi link segítségével szavazhatsz (bejelentkezés szükséges):</p>\r\n<p><a href=\"index.php?option=com_alternativak&amp;view=alternativaklist&amp;task=browse&amp;limit=20&amp;limitstart=0&amp;filterStr=&amp;order=1&amp;temakor=41&amp;szavazas=47\">http://li-de.tk/index.php?option=com_alternativak&amp;view=alternativaklist&amp;task=browse&amp;limit=20&amp;limitstart=0&amp;filterStr=&amp;order=1&amp;temakor=41&amp;szavazas=47</a></p>\r\n<p> </p>\r\n<p>Ugyan itt figyelemmel kísérheted a szavazás eredményének alakulását is.</p>\r\n<p> </p>\r\n<p style=\"text-align: right;\">Utopszkij</p>\r\n<p> </p>\r\n<p> </p>\r\n</td>\r\n<td class=\"w20\" style=\"background-color: #fff;\" width=\"20\"> </td>\r\n<td class=\"w40\" style=\"background-color: #ebebeb;\" width=\"40\"> </td>\r\n</tr>\r\n<tr class=\"acyeditor_delete\">\r\n<td class=\"w40\" style=\"background-color: #ebebeb;\" width=\"40\"> </td>\r\n<td class=\"w20\" style=\"background-color: #fff;\" width=\"20\"> </td>\r\n<td class=\"w480\" style=\"background-color: #fff;\" width=\"480\" height=\"20\"> </td>\r\n<td class=\"w20\" style=\"background-color: #fff;\" width=\"20\"> </td>\r\n<td class=\"w40\" style=\"background-color: #ebebeb;\" width=\"40\"> </td>\r\n</tr>\r\n<tr class=\"acyeditor_delete\" style=\"line-height: 0px;\">\r\n<td class=\"w600\" style=\"background-color: #ebebeb;\" colspan=\"5\" width=\"600\"><img class=\"w600\" src=\"media/com_acymailing/templates/newsletter-4/images/bottom.png\" alt=\" - - - \" /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<div class=\"acyeditor_delete acyeditor_text\" style=\"text-align: center;\">Nem akarsz több ilyen levelet kapni? {unsubscribe}Leiratkozás{/unsubscribe}</div>\r\n</div>', '', '1', '1422991154', '1422989994', '', '', '', '', 'news', '1', '66', 'elovalasztas-a-veszpremi-idokozi-valasztashoz', NULL, '1', '1', 'XBj4TCBw', NULL, NULL, '66', '', '', NULL, '', NULL, NULL, '');
CREATE TABLE `#__acymailing_queue` (   `senddate` int(10) unsigned NOT NULL,   `subid` int(10) unsigned NOT NULL,   `mailid` mediumint(8) unsigned NOT NULL,   `priority` tinyint(3) unsigned DEFAULT '3',   `try` tinyint(3) unsigned NOT NULL DEFAULT '0',   `paramqueue` varchar(250) DEFAULT NULL,   PRIMARY KEY (`subid`,`mailid`),   KEY `listingindex` (`senddate`,`subid`),   KEY `mailidindex` (`mailid`),   KEY `orderingindex` (`priority`,`senddate`,`subid`) ) ENGINE=MyISAM DEFAULT CHARSET=utf8;
CREATE TABLE `#__acymailing_rules` (   `ruleid` smallint(5) unsigned NOT NULL AUTO_INCREMENT,   `name` varchar(250) NOT NULL,   `ordering` smallint(6) DEFAULT NULL,   `regex` text NOT NULL,   `executed_on` text NOT NULL,   `action_message` text NOT NULL,   `action_user` text NOT NULL,   `published` tinyint(3) unsigned NOT NULL,   PRIMARY KEY (`ruleid`),   KEY `ordering` (`published`,`ordering`) ) ENGINE=MyISAM DEFAULT CHARSET=utf8;
CREATE TABLE `#__acymailing_stats` (   `mailid` mediumint(8) unsigned NOT NULL,   `senthtml` int(10) unsigned NOT NULL DEFAULT '0',   `senttext` int(10) unsigned NOT NULL DEFAULT '0',   `senddate` int(10) unsigned NOT NULL,   `openunique` mediumint(8) unsigned NOT NULL DEFAULT '0',   `opentotal` int(10) unsigned NOT NULL DEFAULT '0',   `bounceunique` mediumint(8) unsigned NOT NULL DEFAULT '0',   `fail` mediumint(8) unsigned NOT NULL DEFAULT '0',   `clicktotal` int(10) unsigned NOT NULL DEFAULT '0',   `clickunique` mediumint(8) unsigned NOT NULL DEFAULT '0',   `unsub` mediumint(8) unsigned NOT NULL DEFAULT '0',   `forward` mediumint(8) unsigned NOT NULL DEFAULT '0',   `bouncedetails` text,   PRIMARY KEY (`mailid`),   KEY `senddateindex` (`senddate`) ) ENGINE=MyISAM DEFAULT CHARSET=utf8;
